INSERT INTO `club` (`Name`, `Mission_Statement`, `Nickname`, `Concentration`, `Description`, `Logo`, `Dues`, `Constitution`, `Application`, `Bylaws`, `Website`, `Funding_source`, `Founding_date`, `Costs`, `meeting_time`, `meeting_days`, `meeting_location`, `Club_ID`, `Update_By`) VALUES
('Mechatronics and Robotics Society', 'robotics mission statement', 'MARS', 'Computer Science, Electrical Engineering, AI', 'MARS is a network of students interested in working on and developing an excavating robot for the NASA Robotics Mining Competition. Student members can choose to come to workshops, where essential skills such as 3D CAD, circuit design and circuit CAD, machining, and other tools are taught for future use. MARS is an outlet for hands on engineering that students generally do not get to experience in their classes.', NULL, 0, NULL, NULL, NULL, 'https://hoosmininguva.wixsite.com/hoosminingatuva', 'SAF, ELF, Parents Fund, UVA concessions', '2013-03-02', 20.5, '13:00:00', 'Su', 'Lacy Hall', 0, NULL),
('Student Planners Association', NULL, 'SPA', 'Academic & Professional, Public Service, Social & Hobby, Architecture', 'The purpose of the Student Planners Association at UVA (\'SPA\') is to promote the general understanding of urban planning practice at the University of Virginia (\'UVA\') and UVA School of Architecture (\'A-School\') and to support the professional and academic development of our members. SPA is a Planning Student Organization (PSO) as defined by the American Planning Association (APA).', NULL, 30, NULL, NULL, NULL, NULL, 'SAF, alumni organizations, dues, fundraisers', '2007-04-03', 0, NULL, NULL, NULL, 1, 'stq8rn'),
('Accounting Society at McIntire', NULL, NULL, 'Academic & Professional, Administrative Unit, Honor Society, McIntire School of Commerce', 'Among its objectives, the Accounting Society at McIntire recognizes scholastic and professional excellence in the field of accounting, finance, and information technology. It provides a forum in which students interested in business may interact with, learn more about, and create networks with working professionals. The Accounting Society promotes leadership, integrity, continuous learning, and service through participation in a variety of rewarding professional, social, and community activities. It recognizes individuals whose time and efforts contribute significantly to promoting the organization and serve the student body, the University, and the greater community.', NULL, 0, NULL, NULL, NULL, NULL, 'McIntire', NULL, 0, NULL, NULL, NULL, 2, 'st2mf'),
('Association for Women in Sports Media', NULL, 'AWSM', 'Academic & Professional, Media & Publications, Social & Hobby', 'AWSM is the UVA chapter of the Association of Women in Sports Media, a national organization that works to promote and increase diversity in sports media through career-enhancement networking and mentoring initiatives in the Sports Media industry!', NULL, 20, NULL, NULL, NULL, 'http://www.awsmonline.org/', NULL, NULL, 0, NULL, NULL, NULL, 3, 'arc9de');
INSERT INTO `club` (`Name`, `Mission_Statement`, `Nickname`, `Concentration`, `Description`, `Logo`, `Dues`, `Constitution`, `Application`, `Bylaws`, `Website`, `Funding_source`, `Founding_date`, `Costs`, `meeting_time`, `meeting_days`, `meeting_location`, `Club_ID`, `Update_By`) VALUES
('Aviation Club at UVA', 'aviation club mission statement', 'AC', 'Academic & Professional, Social & Hobby', 'The Aviation Club at UVA is designed to expose students to concepts of flight, facilitate the use of the Aerospace Engineering Flight Simulator, and provide aspiring student pilots with resources and knowledge to succeed. The club is made to inform students about local aviation events such as airshows and flight education events. It is a new club, and there are a lot of ideas developing of what else the club can do, such as guest speakers who have aviation experience, educational sessions, and private pilot\'s license ground school.', , 0, NULL, NULL, NULL, '', 'MAE department, fundraising', '2022-01-02', 50, '15:00:00', 'Fr', 'MAE Building', 4, 'mch7fd');
INSERT INTO `club` (`Name`, `Mission_Statement`, `Nickname`, `Concentration`, `Description`, `Logo`, `Dues`, `Constitution`, `Application`, `Bylaws`, `Website`, `Funding_source`, `Founding_date`, `Costs`, `meeting_time`, `meeting_days`, `meeting_location`, `Club_ID`, `Update_By`) VALUES
('Electronics Club at UVA', 'electronics club mission statement', 'ELEC', 'Academic & Professional, Social & Hobby', 'This club aims to collect fellow electronics and programming enthusiasts to learn about, design, and build exciting projects, such as an 8-bit computer. In the club, members have the opportunity to get hands-on experience in building a computer including a clock, central processing unit, memory, and output to an LCD screen. The club consists of design workshops where members get into small groups to build and debug their own computers, presentations where members get to learn about new design strategies and tips, and participate in gaming competitions.', , 12, , , , '', 'dues, saf', '2021-01-02', 0, '13:00:00', 'Su', 'CPE Lounge Thornton Hall', 5, 'ha8yt');
INSERT INTO `club` (`Name`, `Mission_Statement`, `Nickname`, `Concentration`, `Description`, `Logo`, `Dues`, `Constitution`, `Application`, `Bylaws`, `Website`, `Funding_source`, `Founding_date`, `Costs`, `meeting_time`, `meeting_days`, `meeting_location`, `Club_ID`, `Update_By`) VALUES
('Marine Science Society', 'MSS club mission statement', 'MSS', 'Academic & Professional, Social & Hobby', 'We are a social club committed to inspiring and connecting members to marine science.', NULL, 0, NULL, NULL, NULL, NULL, 'SAF, fundraising', '2022-01-02', 0, NULL, NULL, NULL, 6, NULL),
('Plant Club at UVA', 'Plant club mission statement', 'PCatUVA', 'Social & Hobby, Sustainability', 'The UVA Plant club is focused on connecting fellow plant enthusiasts across the UVA community, and giving them a place where they can show off their collections, give advice to others, create a centralized catalog, and more. At our meetings members are strongly encouraged to bring their plants, extra nursery pots, and cuttings they would like to give away. At our meetings we will also have a short care presentation or plant showcase presentation by one of our members. We are creating a central catalog of all unique plants that our members have, so please update us when you get a new plant!', NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, 7, 'sc5tj'),
('Pre-Dental Society', 'PDS mission', 'PDS', 'Academic & Professional', 'The Pre-Dental Society serves as a resource for students interested in pursuing the field of dentistry. The Society helps students familiarize themselves with the dental school application processes, the requirements for admission, the AADSAS and ADEA programs, and guidelines of the DAT (dental admissions test). The Society invites and welcomes area speakers, organizes tours (dental schools, dental laboratories, private practices, free clinics, etc.), holds monthly meetings, distributes informational resources, and promotes opportunities for dental volunteering, local outreach opportunities, in-office observation, and networking for involved members.', NULL, 10, NULL, NULL, NULL, 'https://predentalatuva.wixsite.com/pds-at-uva', 'Fundraising', '2002-01-01', 0, NULL, NULL, NULL, 8, 'bte76e'),
('Gizmologists', 'Gizmologists club mission statement', 'GIZMO', 'Academic & Professional, Social & Hobby', 'Gizmologists is an organization that supports student-run small-scale engineering projects. We pride ourselves on encouraging students of any major to try their luck at engineering (including non-engineers); whether you have a wealth of experience or none at all we have a place for you! Most projects are interdisciplinary so as to allow you to find what you enjoy/what you don\'t. The more experienced engineers will lead demos and take a lead role in projects so as to ensure everyone is constantly learning and those with less experience are never feeling overwhelmed.', NULL, 20, NULL, NULL, NULL, NULL, 'UVA Experiential Learning Fund', '2015-01-01', 20, NULL, NULL, 'The MILL (Basement of Mechanical Engineering Building)', 9, 'bw6mp'),
('ALPFA at UVA', NULL, 'ALPFA', 'Cultural & Ethnic, Internships and Employment', 'As Latino students at the University of Virginia, we are excited to announce that we are starting UVAs ALPFA (Association of Latino Professionals For America) chapter. This will be a club that will help you out with all things recruiting so that Latinos at IVA can get their dream job or internship! ALPFA is a national organization that focuses on promoting Latinos professional careers and creating networking opportunities that lead to internships and jobs. Additionally, we seek to offer support and preparation through application processes in a wide variety of areas like consulting, investment banking, and many other industries. We also want to be a resource fro students without permanent work authorization in the US, as the job market for them has become increasingly harder.', NULL, 0, NULL, NULL, NULL, NULL, 'SAF', '2022-01-11', 0, NULL, NULL, NULL, 10, 'juf2gd');
INSERT INTO `club` (`Name`, `Mission_Statement`, `Nickname`, `Concentration`, `Description`, `Logo`, `Dues`, `Constitution`, `Application`, `Bylaws`, `Website`, `Funding_source`, `Founding_date`, `Costs`, `meeting_time`, `meeting_days`, `meeting_location`, `Club_ID`, `Update_By`) VALUES
('Database Systems at UVA', 'We aspire to educate on and construct scalable database systems to students at UVA. We have assisted with designing databases for UVA websites and plan to continue assisting UVA into the future with a design-based mindset focused on efficiency and elegancy.', 'DSUVA', 'Database Construction, Computer Science', 'Come join us in building scalable databases! By joining the club, you will learn everything about writing SQL as well as designing efficient database systems that focus on performance and organization. You will also get to assist UVA by potentially working on Database Systems for the University\'s many websites! ', , 20, , , , '', 'UVA grants, member dues', '2023-04-29', 0, '19:00:00', 'TuTh', 'Rice 135', 11, 'gtr5ew');

